%script
--apply score logic to test data set
drop table WMT_GV_NN_1_TEST;
drop table WMT_GV_NN_2_TEST;
drop table WMT_GV_NN_3_TEST;

BEGIN
  DBMS_DATA_MINING.APPLY('WMT_GV_NN_1','TEST_WMT','TXN_UID','WMT_GV_NN_1_TEST');
  DBMS_DATA_MINING.APPLY('WMT_GV_NN_2','TEST_WMT','TXN_UID','WMT_GV_NN_2_TEST');
  DBMS_DATA_MINING.APPLY('WMT_GV_NN_3','TEST_WMT','TXN_UID','WMT_GV_NN_3_TEST');
END;

%script
--take a look at performance for the training data set
drop table WMT_GV_NN_TRAIN;

BEGIN
  DBMS_DATA_MINING.APPLY('WMT_GV_NN_1','TRAIN_WMT','TXN_UID','WMT_GV_NN_TRAIN');
END;

%script
begin
execute immediate 'drop table BIN_TBL_WMT_GV';
exception when others then null;
end;

begin
dbms_data_mining_transform.create_bin_num(bin_table_name => 'BIN_TBL_WMT_GV');
dbms_data_mining_transform.insert_bin_num_qtile(
    bin_table_name     => 'BIN_TBL_WMT_GV',
    data_table_name    => 'NN_TRAIN_PROBS_WMT',
    bin_num            => 50,
    exclude_list       => dbms_data_mining_transform.COLUMN_LIST('TXN_UID'));
commit;
exception when others then null;
end;

%script
begin

begin
execute immediate 'drop view BIN_TBL_WMT_GV_VW';
exception when others then null;
end;

begin
dbms_data_mining_transform.xform_bin_num(
    bin_table_name      => 'BIN_TBL_WMT_GV',
    data_table_name     => 'NN_TRAIN_PROBS_WMT',
    xform_view_name     => 'BIN_TBL_WMT_GV_VW');
commit;
exception when others then null;
end;

begin
update train_bin set bin = .1 where bin is null;
commit;
end;

end;

